import React, { useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import { isLoggedIn, isAdmin } from '../utils/auth';
import '../Styles.css';
import '../Navbar.css';

function Home() {
  const navigate = useNavigate();

  useEffect(() => {
    if (isLoggedIn()) {
      if (isAdmin()) {
        navigate('/admin/dashboard');
      } else {
        navigate('/rooms');
      }
    }
  }, []);

  return (
    <div>

    </div>
  );
}

export default Home;
